import React from "react";
import {
  Container,
  Row,
  Col,
  Card,
  CardBody,
  FormInput,
  Form,
} from "shards-react";

import "../styles/login.css";

export default class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  };

  render() {
    return (
      <Container fluid className="main-content-container px-4 h-100">
        <Row noGutters className="h-100">
          <Col md="5" lg="3" className="mx-auto login">
            <Card small className="mb-4">
              <CardBody>
                {/* <img class="login__logo d-table mx-auto mb-3" src="../images/shards-dashboards-logo.svg" alt="Login Template" /> */}
                <h5 class="login__titulo text-center mt-5 mb-4">Ingresa a tu cuenta</h5>
                <Form>
                  <Row form>
                    <label htmlFor="email">Email</label>
                    <FormInput
                      id="email"
                      type="email"
                      placeholder="Email"
                    />
                    <label htmlFor="email">Contraseña</label>
                    <FormInput
                      id="password"
                      type="password"
                      placeholder="Contraseña"
                    />
                  </Row>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </Container>
    );
  }
}
